import React, { useContext } from 'react'
import { useNavigate } from 'react-router-dom'
import { Button } from '../UI/Button/Button';
import { NavLink } from 'react-router-dom';
import { Cookies  } from 'react-cookie'
import { userContext } from '../../userContext';

export const Nav = () => {

    const navigate = useNavigate();
    const user = useContext(userContext)
    const redirectLogin = () => navigate('/login')

    const logoutHandler = () => {
        Cookies.remove('token')
        navigate('/')
    }


    return (
        <div className="flex w-full justify-between py-5 px-10 font-mono">
            <section className="flex w-1/5 justify-around font-bold">
                <p className=" cursor-pointer"><NavLink to="/">HOME</NavLink></p>
                {user.data ? <p>PROFILE</p> : null}
            </section>  

            <section className="flex justify-between">
                <Button onClick={user.data ? logoutHandler : redirectLogin} name={user.data ? "LOGOUT" : "LOGIN"}/>
            </section>
        </div>
    )
}
